.
QUITINETE
É uma demanda muito comum  para pessoas solteiras ou casais sem filhos. É uma habitação compacta, geralmente com ambientes conjugados. Como o espaço é menor, é fácil de decorar, fazer a limpeza e manter a organização. Também é um atrativo para investimentos por haver sempre uma boa procura.
.
CASA GEMINADA
Engloba construções idênticas, com o mesmo visual e divisões, erguidas em um terreno repartido proporcionalmente. A separação entre elas é feita por uma parede, como se fosse uma divisória. O estacionamento, as áreas de lazer e serviço podem ser compartilhados.
.
APARTAMENTO
Esse tipo de imóvel têm suas divisões de cômodos definidas e, geralmente, são especificados pelo número de quartos que têm. Também pode ser identificado pela quantidade de andares que tem (duplex e triplex, geralmente localizados em coberturas). Outro tipo de apartamento é o giardino/garden, que fica normalmente situado no andar térreo e dispõe de jardim ou um quintal. 
.
FLAT
Trata-se de um apartamento residencial pequeno, que dispõe de serviços similares a um hotel, mas com taxas menores e sem muitas formalidades. Os benefícios variam conforme as regras do condomínio, mas usualmente, estão incluídos os serviços de portaria 24h, lavanderia, área de lazer e outros que podem variar.
.
LOFT
O termo é usado na definição de um apartamento amplo que não tem os ambientes divididos por paredes, com pé-direito alto, mezanino e grandes janelas que favorecem a iluminação natural e a economia de energia.
.
COBERTURA
É localizada no último andar dos prédios de apartamento e geralmente disponibiliza diversas facilidades, como diferenciais em relação às demais unidades do edifício. Sua área, no geral, equivale ao tamanho de dois apartamentos do prédio onde está situada, com os bônus de lazer. Além disso, permite vivenciar a privacidade típica das casas e a segurança proporcionada pela vida em condomínio. 
.
